INSERT INTO `new_dd` VALUES ('1', '中融民信_登录', '/welcome \n', '2017-04-16 10:58:34', '<body>\\n		<div id=\\\"wrap\\\">\\n			<div id=\\\"header\\\">\\n				<div class=\\\"header_bg\\\">\\n					<img src=\\\"/static/images/login/login_header.png\\\" />\\n				</div>\\n				<div class=\\\"logo\\\">\\n					<img src=\\\"/static/images/login/logo.png\\\" />\\n				</div>\\n			</div>\\n			<div id=\\\"content\\\">\\n				<div class=\\\"cont_center\\\">\\n					<div>\\n						<div class=\\\"bg_img\\\"></div>\\n						<div class=\\\"pos_img\\\"></div>\\n					</div>\\n					<div class=\\\"con_img\\\">\\n						<div class=\\\"cont_left\\\"></div>\\n						<div class=\\\"cont_right\\\">\\n							<div class=\\\"right_top\\\">\\n								<div class=\\\"top_center\\\">\\n									<div class=\\\"top_bottom\\\"></div>\\n								</div>\\n							</div>\\n							<div class=\\\"right_center\\\">\\n								<form id=\\\"loginForm\\\" name=\\\"loginForm\\\" class=\\\"left\\\" target=\\\"_self\\\"\\n									action=\\\"/welcome/login.do\\\" method=\\\"post\\\">\\n									\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n    \\n    \\n        <meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=8,chrome=1\\\">\\n    \\n\\n<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html;charset=UTF-8\\\">\\n<meta http-equiv=\\\"Pragma\\\" content=\\\"no-cache\\\">\\n<meta http-equiv=\\\"Cache-Control\\\" content=\\\"no-store, no-cache, must-revalidate, pre-check=0, post-check=0, max-age=0\\\">\\n<meta http-equiv=\\\"Expires\\\" content=\\\"0\\\">\\n<script type=\\\"text/javascript\\\" >\\nvar stcPath = \\\'/static\\\';\\n\\nwindow.onload=function(){ \\n	//firefox and opera backspace   \\n    document.onkeypress = banBackSpace;  \\n    //ie and chorme backspace\\n    document.onkeydown = banBackSpace;  \\n}\\n\\nfunction banBackSpace(e){  \\n    \\n    var ev = e || window.event;     \\n    var obj = ev.target || ev.srcElement;\\n    var t = obj.type || obj.getAttribute(\\\'type\\\');       \\n    \\n    var vReadOnly = obj.readOnly;  \\n    var vDisabled = obj.disabled;  \\n       \\n    vReadOnly = (vReadOnly == undefined) ? false : vReadOnly;  \\n    vDisabled = (vDisabled == undefined) ? true : vDisabled;  \\n    var flag1 = ev.keyCode == 8 && (t == \\\"password\\\" || t == \\\"text\\\" || t == \\\"textarea\\\") && (vReadOnly == true || vDisabled == true);  \\n    var flag2 = ev.keyCode == 8 && t != \\\"password\\\" && t != \\\"text\\\" && t != \\\"textarea\\\";\\n    if (flag2 || flag1)\\n        event.returnValue = false;\\n}  \\n</script>\\n<input type=\\\"hidden\\\" id=\\\"ctx\\\" value=\\\"/welcome\\\">\\n\\n<style>\\n<!--\\n	.messageDiv{\\n		  border-bottom: 0px;\\n		  cursor: default;\\n		  width:100%;\\n		  height:      22px;\\n		  line-height: 22px;\\n		  vertical-align: middle;\\n		  text-decoration: none;\\n		  font-weight: 800;\\n		  font-size: 13px;\\n		  width:100%;\\n		  height:25px;\\n		  font-size:12px;\\n		  background-color:#d6e4ef;\\n	}\\n-->\\n</style>\\n\\n									<div>\\n										<span>用户名</span><input type=\\\"text\\\" name=\\\"userName\\\" id=\\\"userName\\\" value=\\\"\\\" onkeypress=\\\"userNameKeyPress(event);\\\"/>\\n									</div>\\n									<div class=\\\"diff_bg\\\">\\n										<span>密&nbsp;&nbsp;&nbsp;码</span><input type=\\\"password\\\" id=\\\"password\\\" name=\\\"password\\\" value=\\\"\\\" onkeypress=\\\"passwordKeyPress(event);\\\"/>\\n									</div>\\n									\\n									<div class=\\\"diff_bg\\\">									\\n									<span>验&nbsp;证&nbsp;码</span>\\n									<input  type=\\\"text\\\" id=\\\"code\\\" name=\\\"code\\\" value=\\\"\\\"  onkeypress=\\\"codeKeyPress(event)\\\"/>\\n									</div>\\n									<img alt=\\\"验证码\\\" id=\\\"safecode\\\" src=\\\"/servlet/ImageServlet\\\"  onclick=\\\"javascript:reloadVerifyCode();\\\">\\n									  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<a href=\\\"javascript:reloadVerifyCode();\\\" onclick=\\\"reloadVerifyCode();\\\" style=\\\"line-height:40px;\\\">换一张</a>\\n									<div class=\\\"diff_div\\\">\\n										<input type=\\\"button\\\"  id = \\\"login\\\" name=\\\"login\\\" class=\\\"login\\\" onclick=\\\"onSubmitform();\\\" /> \\n										<input type=\\\"button\\\" name=\\\"login_reset\\\" class=\\\"login_reset\\\" onclick=\\\"onResetAll();\\\" />\\n									</div>	\\n									<div class=\\\"diff_div\\\">\\n										<a style=\\\"color:#999999;font-size:12px;width:150px\\\"  href=\\\"javascript:loginAgin();\\\">用户被锁时请点击此处</a>\\n									</div>	\\n								</form>\\n							</div>\\n							<div class=\\\"right_foot\\\">\\n								<div class=\\\"foot_center\\\">\\n									<div class=\\\"foot_bottom\\\"></div>\\n								</div>\\n							</div>\\n						</div>\\n					</div>\\n				</div>\\n			</div>\\n		</div>\\n	</body>', '0', null, '123132');
