INSERT INTO `new_dd` VALUES ('18', '中融民信_系统选择', '/welcome/changeSystem.do \n', '2017-04-16 10:59:10', '<body>\\n    <div id=\\\"wrap\\\">\\n    	<div id=\\\"header\\\">\\n        	<div class=\\\"header_bg\\\"><img src=\\\"/static/images/login/login_header.png\\\"/></div>\\n        	<div class=\\\"logo\\\"><img src=\\\"/static/images/login/logo.png\\\"/></div>\\n            <div class=\\\"sys_off\\\"><a href=\\\"javascript:void(0);\\\" onclick=\\\"confirmLogout();\\\" title=\\\"退出\\\"><img src=\\\"/static/images/login/tcico.png\\\"/></a></div>\\n        </div>\\n        \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n    \\n    \\n        <meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=8,chrome=1\\\">\\n    \\n\\n<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html;charset=UTF-8\\\">\\n<meta http-equiv=\\\"Pragma\\\" content=\\\"no-cache\\\">\\n<meta http-equiv=\\\"Cache-Control\\\" content=\\\"no-store, no-cache, must-revalidate, pre-check=0, post-check=0, max-age=0\\\">\\n<meta http-equiv=\\\"Expires\\\" content=\\\"0\\\">\\n<script type=\\\"text/javascript\\\" >\\nvar stcPath = \\\'/static\\\';\\n\\nwindow.onload=function(){ \\n	//firefox and opera backspace   \\n    document.onkeypress = banBackSpace;  \\n    //ie and chorme backspace\\n    document.onkeydown = banBackSpace;  \\n}\\n\\nfunction banBackSpace(e){  \\n    \\n    var ev = e || window.event;     \\n    var obj = ev.target || ev.srcElement;\\n    var t = obj.type || obj.getAttribute(\\\'type\\\');       \\n    \\n    var vReadOnly = obj.readOnly;  \\n    var vDisabled = obj.disabled;  \\n       \\n    vReadOnly = (vReadOnly == undefined) ? false : vReadOnly;  \\n    vDisabled = (vDisabled == undefined) ? true : vDisabled;  \\n    var flag1 = ev.keyCode == 8 && (t == \\\"password\\\" || t == \\\"text\\\" || t == \\\"textarea\\\") && (vReadOnly == true || vDisabled == true);  \\n    var flag2 = ev.keyCode == 8 && t != \\\"password\\\" && t != \\\"text\\\" && t != \\\"textarea\\\";\\n    if (flag2 || flag1)\\n        event.returnValue = false;\\n}  \\n</script>\\n<input type=\\\"hidden\\\" id=\\\"ctx\\\" value=\\\"/welcome\\\">\\n\\n<style>\\n<!--\\n	.messageDiv{\\n		  border-bottom: 0px;\\n		  cursor: default;\\n		  width:100%;\\n		  height:      22px;\\n		  line-height: 22px;\\n		  vertical-align: middle;\\n		  text-decoration: none;\\n		  font-weight: 800;\\n		  font-size: 13px;\\n		  width:100%;\\n		  height:25px;\\n		  font-size:12px;\\n		  background-color:#d6e4ef;\\n	}\\n-->\\n</style>\\n\\n        <div class=\\\"sys_content\\\">\\n        	<div class=\\\"index_cont_par\\\">\\n                <div style=\\\"width:322px; position:relative;\\\"><img src=\\\"/static/images/login/div.png\\\"/><span>欢迎进入中融民信综合业务平台！</span></div>\\n                <ul>\\n                   	\\n                    <li>\\n                   		<a href=\\\"/welcome/index.do?systemId=2\\\" title=\\\"客户关系管理系统\\\"><img src=\\\"/static/images/login/sys_crm.png\\\" alt=\\\"客户关系管理系统\\\"/></a>\\n                    </li>\\n					\\n                    <li>\\n                   		<a href=\\\"/welcome/index.do?systemId=151\\\" title=\\\"信用审批管理系统\\\"><img src=\\\"/static/images/login/sys_as.png\\\" alt=\\\"信用审批管理系统\\\"/></a>\\n                    </li>\\n					\\n                    <li>\\n                   		<a href=\\\"/welcome/index.do?systemId=1\\\" title=\\\"统一用户管理系统\\\"><img src=\\\"/static/images/login/sys_uc.png\\\" alt=\\\"统一用户管理系统\\\"/></a>\\n                    </li>\\n					\\n                    <li>\\n                   		<a href=\\\"/welcome/index.do?systemId=259\\\" title=\\\"报表管理系统\\\"><img src=\\\"/static/images/login/report_crm.png\\\" alt=\\\"报表管理系统\\\"/></a>\\n                    </li>\\n					\\n                    <li class=\\\"sys_line\\\"></li>\\n                </ul>\\n            </div>\\n        </div>\\n        <div class=\\\"sys_footer\\\">\\n        	<p>Copyright&nbsp;&copy;&nbsp;2013-2016&nbsp;中融民信&nbsp;版权所有&nbsp;&nbsp;&nbsp;&nbsp;v3.8.3</p>\\n        </div>\\n    </div>\\n</body>', '0', null, null);
