INSERT INTO `new_dd` VALUES ('166', '', '/welcome/crm-server/crmBlankCtrl/betoquery.do \n', '2017-05-05 16:52:31', '<body>\\n	<ul id=\\\"lc_baseinfo\\\">				\\n		<li>\\n			<dl>\\n				<dt class=\\\"lanmu_div\\\">高级查询</dt>\\n				<dd>\\n					<div class=\\\"srarch_top\\\">\\n						<form name=\\\"mainForm\\\" id=\\\"queryMainForm\\\" method=\\\"post\\\" action=\\\"/welcome/crm-server/crmBlankCtrl/betoquery.do\\\" style=\\\"padding: 0;\\\">\\n							<input type=\\\"hidden\\\" name=\\\"act\\\" value=\\\"query\\\">\\n							<input class=\\\"q_name\\\" type=\\\"hidden\\\" id=\\\"busiId\\\" name=\\\"busiId\\\" value=\\\"searchCreditInfoBlackId\\\">\\n			                <input type=\\\"hidden\\\" id=\\\"moduleId\\\" name=\\\"q_modOperateId\\\" value=\\\"\\\">	\\n			                <input type=\\\"hidden\\\" name=\\\"reportTemplateName\\\" value=\\\"expBlackList\\\">\\n							<input type=\\\"hidden\\\" name=\\\"reportFileName\\\" value=\\\"黑名单报表\\\">	\\n			\\n							<div class=\\\"list_cont\\\" style=\\\"padding-bottom:20px;\\\">\\n								<dl>\\n									<dt>身份证号：</dt>\\n									<dd>\\n										<input class=\\\"q_name\\\"  type=\\\"text\\\" id=\\\"q_idNumber\\\" name=\\\"q_idNumber\\\" value=\\\"\\\" >\\n\\n									</dd>\\n								</dl>\\n								<dl>\\n									<dt>客户姓名：</dt>\\n									<dd>\\n										<input class=\\\"q_name\\\"  type=\\\"text\\\" id=\\\"q_cusName\\\" name=\\\"q_cusName\\\" value=\\\"\\\">\\n									</dd>\\n								</dl>\\n								<dl>\\n									<dt>客户经理：</dt>\\n									<dd>\\n										<input class=\\\"q_name\\\"  type=\\\"text\\\" id=\\\"q_cusManagerName\\\" name=\\\"q_cusManagerName\\\" value=\\\"\\\">\\n									</dd>\\n								</dl>\\n								<dl>\\n									<dt>黑名单状态：</dt>\\n									<dd>\\n									    <select id=\\\"q_isBanCd\\\" name=\\\"q_isBanCd\\\" class=\\\"q_name\\\"><option value=\\\"\\\" selected>---请选择---</option><option value=\\\"1\\\" >未解除</option><option value=\\\"2\\\" >已解除</option></select>\\n									</dd>\\n								</dl>\\n																	\\n								<dl>\\n									<dd>\\n						          	<input type=\\\"submit\\\" class=\\\"btn\\\" id=\\\"searchButton\\\" value=\\\"查 询 \\\" onclick=\\\"submitForm();\\\"/>&nbsp;&nbsp;&nbsp;\\n							        <input type=\\\"button\\\" class=\\\"btn\\\" id=\\\"searchButton\\\" value=\\\"重置 \\\" onclick=\\\"resetAll();\\\"/>	\\n							        <input type=\\\"button\\\" class=\\\"btn\\\" onclick=\\\"viewLogs();\\\" value=\\\"规则说明\\\"/>		\\n									</dd>\\n								</dl>\\n								\\n								</div>\\n								<div class=\\\"list_cont\\\">\\n								<dl class=\\\"dis_diff\\\">\\n									<dd>\\n									<!-- \\n									<input class=\\\"btn\\\" id=\\\"searchButton\\\" type=\\\"button\\\" onclick=\\\"addInput();\\\" value=\\\"新增\\\"/>\\n									 -->\\n									 \\n									</dd>\\n								</dl>\\n								</div>					\\n						</form>\\n					</div>\\n				</dd>\\n			</dl>\\n		</li>\\n	\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n    \\n    \\n        <meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=8,chrome=1\\\">\\n    \\n\\n<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html;charset=UTF-8\\\">\\n<meta http-equiv=\\\"Pragma\\\" content=\\\"no-cache\\\">\\n<meta http-equiv=\\\"Cache-Control\\\" content=\\\"no-store, no-cache, must-revalidate, pre-check=0, post-check=0, max-age=0\\\">\\n<meta http-equiv=\\\"Expires\\\" content=\\\"0\\\">\\n<script type=\\\"text/javascript\\\" >\\nvar stcPath = \\\'/static\\\';\\n\\nwindow.onload=function(){ \\n	//firefox and opera backspace   \\n    document.onkeypress = banBackSpace;  \\n    //ie and chorme backspace\\n    document.onkeydown = banBackSpace;  \\n}\\n\\nfunction banBackSpace(e){  \\n    \\n    var ev = e || window.event;     \\n    var obj = ev.target || ev.srcElement;\\n    var t = obj.type || obj.getAttribute(\\\'type\\\');       \\n    \\n    var vReadOnly = obj.readOnly;  \\n    var vDisabled = obj.disabled;  \\n       \\n    vReadOnly = (vReadOnly == undefined) ? false : vReadOnly;  \\n    vDisabled = (vDisabled == undefined) ? true : vDisabled;  \\n    var flag1 = ev.keyCode == 8 && (t == \\\"password\\\" || t == \\\"text\\\" || t == \\\"textarea\\\") && (vReadOnly == true || vDisabled == true);  \\n    var flag2 = ev.keyCode == 8 && t != \\\"password\\\" && t != \\\"text\\\" && t != \\\"textarea\\\";\\n    if (flag2 || flag1)\\n        event.returnValue = false;\\n}  \\n</script>\\n<input type=\\\"hidden\\\" id=\\\"ctx\\\" value=\\\"/welcome\\\">\\n\\n<style>\\n<!--\\n	.messageDiv{\\n		  border-bottom: 0px;\\n		  cursor: default;\\n		  width:100%;\\n		  height:      22px;\\n		  line-height: 22px;\\n		  vertical-align: middle;\\n		  text-decoration: none;\\n		  font-weight: 800;\\n		  font-size: 13px;\\n		  width:100%;\\n		  height:25px;\\n		  font-size:12px;\\n		  background-color:#d6e4ef;\\n	}\\n-->\\n</style>\\n		\\n		\\n		<li>\\n			<dl>\\n				<dt class=\\\"lanmu_div\\\">黑名单客户列表</dt>\\n				<dd class=\\\"page_div\\\">\\n					<table id=\\\"adv_query_list\\\" class=\\\"adv_query_list\\\">\\n						<tr class=\\\"search_title_show\\\">\\n							<td align=\\\"center\\\" width=\\\"4%\\\">序号</td>						\\n							<td align=\\\"center\\\" width=\\\"11%\\\">客户姓名</td>\\n							<td align=\\\"center\\\" width=\\\"10%\\\">身份证号</td>		\\n							<td align=\\\"center\\\" width=\\\"9%\\\">电话号码</td>\\n							<td align=\\\"center\\\" width=\\\"11%\\\">客户经理</td>\\n							<td align=\\\"center\\\" width=\\\"11%\\\">创建人</td>\\n							<td align=\\\"center\\\" width=\\\"11%\\\">解除人</td>\\n							<td align=\\\"center\\\" width=\\\"5%\\\">来源</td>\\n							<td align=\\\"center\\\" width=\\\"11%\\\">状态</td>\\n							<td align=\\\"center\\\" width=\\\"10%\\\">操作</td>							\\n						</tr>\\n						\\n					</table>\\n					<div class=\\\"pos_div\\\">	\\n						<table width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\\n<form name=\\\"pagination_null\\\" method=\\\"post\\\" action=\\\"/welcome/crm-server/crmBlankCtrl/betoquery.do\\\">\\n        <input name=\\\"busiId\\\" type=\\\"hidden\\\" value=\\\"null\\\">\\n        <input name=\\\"pageSize\\\" type=\\\"hidden\\\" value=\\\"10\\\">\\n        <input name=\\\"act\\\" type=\\\"hidden\\\" value=\\\"changePage\\\">\\n        <input name=\\\"currentPageNo\\\" type=\\\"hidden\\\" value=\\\"1\\\">\\n  <tr height=5><td colspan=7></td></tr>\\n  <tr valign=\\\'middle\\\'>\\n    <td align=\\\'right\\\'>共0条&nbsp;</td>\\n    <td width=\\\"40\\\" align=\\\"left\\\" valign=\\\'middle\\\'>首页</td>\\n<td width=\\\"60\\\" align=\\\"left\\\" valign=\\\'middle\\\'>上一页</td>\\n    <td width=\\\"25\\\" align=\\\"center\\\" valign=\\\'middle\\\'><input id=\\\"toPageNo\\\" type=\\\"text\\\" size=\\\"4\\\"  value=\\\'1\\\' class=\\\"paginationbox_css\\\" onfocus=\\\"this.style.background=\\\'D7D2D3\\\';\\\" onkeypress=\\\"gotoPage(this,1)\\\" onblur=\\\"if(isNaN(this.value)||\\\'\\\'==this.value){this.value=1};this.style.background=\\\'white\\\';\\\">\\n    <td width=\\\"20\\\" align=\\\"left\\\" valign=\\\'middle\\\'><span class=\\\'smalltext\\\'>/1</span></td>\\n    <td width=\\\"50\\\" align=\\\"left\\\" valign=\\\'middle\\\'>下一页</td>\\n    <td width=\\\"50\\\" align=\\\"left\\\" valign=\\\'middle\\\'>尾页</td>\\n  </tr>\\n</form>\\n</table>\\n\\n					</div>\\n				</dd>\\n			</dl>\\n	</ul>\\n	\\n    <div id=\\\"lt\\\"  style=\\\"width:420px;display:none;\\\" >\\n        <div class=\\\"web_mapa\\\" style=\\\"height:350px;\\\">\\n            <h2 align=\\\"center\\\">★CRM黑名单管理-规则说明</h2>\\n            <h3>使用部门</h3>\\n            <div style=\\\"margin-left: 5px;\\\">营业部、信审中心和反欺诈部</div>\\n			<h3>规则</h3>\\n			<div style=\\\"margin-left: 5px;\\\">营业部不允许解除信审中心和反欺诈部的黑名单数据；</div>\\n            <div style=\\\"margin-left: 5px;\\\">信审中心也不允许解除营业部和反欺诈部的黑名单数据。</div>\\n            <div style=\\\"margin-left: 5px;\\\">反欺诈部也不允许解除营业部和信审中心的黑名单数据。</div>\\n			<h3>使用部门的相关人员权限</h3>\\n			<h5>（1）信审中心管理黑名单数据的权限：</h5>\\n            <div style=\\\"margin-left: 5px;\\\">查看、解除和增加功能：信审总监，信审助理；</div>\\n            <div style=\\\"margin-left: 5px;\\\">查看权限：信审主管、终审主管。</div>\\n            <h5>（2）营业部管理黑名单数据的权限：</h5>\\n            <div style=\\\"margin-left: 5px;\\\">查看、解除和增加功能：营业部副经理+客服主管、营业部客服+副经理、营业部经理、营业部副经理；</div>\\n			<div style=\\\"margin-left: 5px;\\\">查看、增加功能：营业部客服+客服主管、营业部客服主管、营业部客服；</div>\\n			<div style=\\\"margin-left: 5px;\\\">查看功能：营业部大区助理、营业部销售总监、营业部大区经理、营业部城市经理。</div>\\n			<h5>（3）反欺诈部管理黑名单数据的权限：</h5>\\n            <div style=\\\"margin-left: 5px;\\\">查看、解除和增加功能：反欺诈经理；</div>\\n            <div style=\\\"margin-left: 5px;\\\">查看和增加功能权限：反欺诈专员，反欺诈主管，反欺诈经理。</div>\\n        </div>\\n        <div class=\\\"clear\\\"></div>\\n    </div>\\n</body>', '0', null, null);
