INSERT INTO `new_mg` VALUES ('3', '', '/welcome/uc-server/feedbackSuggestsNoticeCtrl/queryFeedbackNoticeBySelf.do?busiId=searchNoticeBySelfList&q_userId=20851&q_noticeUserId=20851&act=query&q_deptId=sysdept \n', '2017-05-05 16:45:36', '<body>\\n	<div>	\\n 	 	<ul class=\\\"tab_list\\\">\\n 	    	<li id=\\\"li1\\\"><a href=\\\"javascript:void(0);\\\" hidefocus=\\\"true\\\">历史反馈问题</a></li>\\n 	        <li id=\\\"li2\\\"><a href=\\\"javascript:void(0);\\\" hidefocus=\\\"true\\\">系统公告</a></li>\\n 	    </ul>	\\n		<div>\\n			       <h3 class=\\\"lanmu_div\\\">高级查询</h3>\\n			           <form name=\\\"mainForm\\\" id=\\\"queryMainForm\\\" method=\\\"post\\\" action=\\\"/welcome/uc-server/feedbackSuggestsNoticeCtrl/queryFeedbackNoticeBySelf.do\\\">\\n			       <div class=\\\"list_cont\\\">\\n			       		  <input type=\\\"hidden\\\" name=\\\"act\\\" value=\\\"query\\\">\\n				          <input type=\\\"hidden\\\" name=\\\"busiId\\\" id=\\\"busiId\\\" value=\\\"\\\">\\n			       	      <input type=\\\"hidden\\\" id=\\\"moduleId\\\" name=\\\"q_modOperateId\\\" value=\\\"\\\">\\n			       	      <input type=\\\"hidden\\\" name=\\\"q_allotAtatus\\\" value=\\\"\\\">\\n						  <input type=\\\"hidden\\\" id=\\\"q_deptId\\\" name=\\\"q_deptId\\\" value=\\\"sysdept\\\">\\n						  <input type=\\\"hidden\\\" id=\\\"q_noticeUserId\\\" name=\\\"q_noticeUserId\\\" value=\\\"20851\\\">\\n						  <input type=\\\"hidden\\\" name=\\\"q_userId\\\" value=\\\"20851\\\">\\n			              <dl>\\n			                  <dt>主题：</dt>\\n			                  <dd><input type=\\\"text\\\" name=\\\"q_title\\\" id=\\\"q_title\\\" size=\\\"10\\\" maxlength=\\\"100\\\" value=\\\"\\\" class=\\\"q_name\\\"></dd>\\n			              </dl>\\n			              <dl>\\n			                  <dt>日期：</dt>\\n			                  <dd><input type=\\\"text\\\" style=\\\"width: 85px;\\\" name=\\\"q_creatStartTime\\\" id=\\\"q_creatStartTime\\\" value=\\\"\\\" readonly=\\\"readonly\\\" size=\\\"15\\\" onkeyup=\\\"this.value=this