isabled = obj.disabled;  \\n       \\n    vReadOnly = (vReadOnly == undefined) ? false : vReadOnly;  \\n    vDisabled = (vDisabled == undefined) ? true : vDisabled;  \\n    var flag1 = ev.keyCode == 8 && (t == \\\"password\\\" || t == \\\"text\\\" || t == \\\"textarea\\\") && (vReadOnly == true || vDisabled == true);  \\n    var flag2 = ev.keyCode == 8 && t != \\\"password\\\" && t != \\\"text\\\" && t != \\\"textarea\\\";\\n    if (flag2 || flag1)\\n        event.returnValue = false;\\n}  \\n</script>\\n<input type=\\\"hidden\\\" id=\\\"ctx\\\" value=\\\"/welcome\\\">\\n\\n<style>\\n<!--\\n	.messageDiv{\\n		  border-bottom: 0px;\\n		  cursor: default;\\n		  width:100%;\\n		  height:      22px;\\n		  line-height: 22px;\\n		  vertical-align: middle;\\n		  text-decoration: none;\\n		  font-weight: 800;\\n		  font-size: 13px;\\n		  width:100%;\\n		  height:25px;\\n		  font-size:12px;\\n		  background-color:#d6e4ef;\\n	}\\n-->\\n</style>\\n 	    	\\n			<h3 class=\\\"lanmu_div\\\"> &nbsp;&nbsp; 消息列表</h3>\\n			<div class=\\\"list_cont page_div\\\">\\n			\\n				\\n				<table class=\\\"adv_query_list\\\">\\n				<tbody>\\n					<tr class=\\\"search_title_show\\\">					\\n		            	<td align=\\\"center\\\" width=\\\"5%\\\">序号</td>\\n		            	<td align=\\\"center\\\" width=\\\"28%\\\">公告主题</td>\\n		                <td align=\\\"center\\\" width=\\\"32%\\\">公告内容</td>\\n		                <td align=\\\"center\\\" width=\\\"20%\\\">发布时间</td>\\n		                <td align=\\\"center\\\" width=\\\"20%\\\">公告状态</td>\\n					</tr>\\n					\\n					<tr align=\\\"center\\\" class=\\\"tdbg\\\">\\n					    <td>1</td>\\n					    <td><input type=\\\"hidden\\\" value=\\\"关于房融贷贷前试算的问题和营业部【逾期客户】、【 罚息减免】权限关闭的通知\\\" id=\\\"titile361\\\">关于房融贷贷前试算的问题和营业部【逾期客户】、【 罚息减免】权限关闭的通知</td>\\n					    <td>\\n					    	<input type=\\\"hidden\\\" value=\\\"通知：请各营业部注意房融贷的贷前试算目前还存在一些问题，其他贷款类型可正常进行试算，这个问题我们会尽快修复。另外信贷系统【逾期客户】和【罚息减免】模块的申请权限已经关闭，有逾期客户划扣和罚息减免的数据，需要通过催收系统进行申请；正常客户的还款可通过信贷系统【汇款还款】和【一次性结清】模块去申请，