款出借金额总和；\\n16.债权特殊、利率特殊  投资管理 、非首期撮合、抵押贷信息特殊利率标红； \\n17. 投资管理&mdash;支付查询改为多选，抵押贷管理&mdash;支付查询改为多选；\\n18.修改邮件发送，以前是调用客户信息中的文件发送方式，现在修改成业务信息变更时，增加邮件发送方式，\\n对每个业务信息配置不同的发送方式 (业务信息变更中增加文件发送方式修改，以前是放在客户信息变更中)\\n19.修改CRM导出报表省市不统一的问题，在CRM端增加备注按钮，配有备注按钮的相关权限人员，可以通过导出报表导出备注信息\\n20.非首期回款定时任务提前10天执行\\\" id=\\\"detail321\\\">\\n					    	<input type=\\\"hidden\\\" value=\\\"57085\\\" id=\\\"noticeStatus321\\\">\\n					    	<a href=\\\"javascript:void(0);\\\" onclick=\\\"getDetail(321);\\\">理财系统更新内容：\\n1、首页：增加投资管理未撮合笔...</a>\\n					    </td>\\n					    <td>2015-03-15 11:51:49</td>\\n					    <td id=\\\"isread321\\\">已阅读</td>\\n					</tr>\\n					\\n					<tr align=\\\"center\\\" class=\\\"tdbg\\\">\\n					    <td>4</td>\\n					    <td><input type=\\\"hidden\\\" value=\\\"信贷业务归属变更权限已开放\\\" id=\\\"titile301\\\">信贷业务归属变更权限已开放</td>\\n					    <td>\\n					    	<input type=\\\"hidden\\\" value=\\\"信贷业务归属变更权限已开放，请各营业部知悉\\\" id=\\\"detail301\\\">\\n					    	<input type=\\\"hidden\\\" value=\\\"57102\\\" id=\\\"noticeStatus301\\\">\\n					    	<a href=\\\"javascript:void(0);\\\" onclick=\\\"getDetail(301);\\\">信贷业务归属变更权限已开放，请各营业部知悉...</a>\\n					    </td>\\n					    <td>2015-03-10 18:27:24</td>\\n					    <td id=\\\"isread301\\\">已阅读</td>\\n					</tr>\\n					\\n					<tr align=\\\"center\\\" class=\\\"tdbg\\\">\\n					    <td>5</td>\\n					    <td><input type=\\\"hidden\\\" value=\\\"催收系统更新内容\\\" id=\\\"titile242\\\">催收系统更新内容</td>\\n					    <td>\\n					    	<input type=\\\"hidden\\\" value=\\\"1.1.列表显示新增&ldquo;提交时间&rdquo;列项，取提交罚息减免申请操作的时间；2.查询条件新增&ldquo;提交时间&rdquo;，区间查询；\\n2.手动分单待分单：修改查询条件，部分结清逾期案件仍可在待分单中继续分单；\\n3.手动分单模块：新增导入分单页面，实现导入excel模版，进行批量分单的功能；具体描述如下：1.下载模版功能；2.按模块规则导入excel文件3.导入文件后，列表显示导入文件中的内容；数据专员选择要分单的客户后，点击&ldquo;分单&rdquo;按钮，执行批量分单操作，分单后给予提示：分单成功！/分单失败XXX条，且列表显示分单失败的数据，4.分单成功的数据不在列表中显示，且在待分单模块中也不做显示，只在已分单模块中进行显示；5.新增删除功能，支持批量删除，选择需要删除的数据后，点击&ldquo;删除&rdquo;按钮进行删除，只针对导入文件中的待分单的数据进行删除，不影响原待分单模块中的数据情况；6.分单后，根据不同情况需要记录流转记录；7.根据查询条件&ldquo;催收员&rdquo;，统计分到催收员手上的案件笔数、金额；8.新增导出功能，可以将分单失败的案件进行导出，导出模块同导入模版的表头一致；表头模版及原型页面，详情见附件\\n4.案件中心：修改查看客户信息返回时查询条件丢失问题；\\n5.修改还款情况查询日志功能，之前经常弹出数据异常提示框；\\n6.手动分单页面：选择要分配的催收员时，屏蔽UC中已经禁用的帐号；\\n7.还款情况查询页面：列表显示应到违约金取还款记录对应的还款前的应到违约金合计；\\\" id=\\\"detail242\\\">\\n					    	<input type=\\\"hidden\\\" value=\\\"0\\\" id=\\\"noticeStatus242\\\">\\n					    	<a href=\\\"javascript:void(0);\\\" onclick=\\\"getDetail(242);\\\">1.1.列表显示新增&ldquo;提交时间&rdqu...</a>\\n					    </td>\\n					    <td>2015-01-16 09:37:45</td>\\n					    <td id=\\\"isread242\\\">新公告</td>\\n					</tr>\\n					\\n					<tr align=\\\"center\\\" class=\\\"tdbg\\\">\\n					    <td>6</td>\\n					    <td><input type=\\\"hidden\\\" value=\\\"理财系统更新通知2015年1月15日\\\" id=\\\"titile241\\\">理财系统更新通知2015年1月15日</td>\\n					    <td>\\n					    	<input type=\\\"hidden\\\" value=\\\"理财系统更新内容：\\n1. CRM端可以申请特殊利率信息变更\\n2. 财富端首页增加特殊利率提示链接（特殊利率弹窗提醒）\\n3. 回款申诉可以回给客户经理\\n4. 手动刷非首期定时任务优化\\n5. CRM端可以申请部分紧急债权转让\\n6. 回款模块--月月享，债权转让---回款时间可以自行修改的功能（单个和批量）\\n7. 债权剔除--页面修改，去编号加产品，点击姓名可以看到剔除债权 和 剔除时间\\n8. 系统中所有可点击出借编号的地方，续投的点击进去可以看到首投的金额等\\n9. 财富端信息变更审核-增加变更时间字段筛选条件\\n10. 可交易债权模块--可交易金额总额，可交易价值总额位置放在最上面显示\\n11.债权转让模块回款价值统计金额BUG修改\\\" id=\\\"detail241\\\">\\n					    	<input type=\\\"hidden\\\" value=\\\"0\\\" id=\\\"noticeStatus241\\\">\\n					    	<a href=\\\"javascript:void(0);\\\" onclick=\\\"getDetail(241);\\\">理财系统更新内容：\\n1. CRM端可以申请特殊利率...</a>\\n					    </td>\\n					    <td>2015-01-16 09:03:42</td>\\n					    <td id=\\\"isread241\\\">新公告</td>\\n					</tr>\\n					\\n					<tr align=\\\"center\\\" class=\\\"tdbg\\\">\\n					    <td>7</td>\\n					    <td><input type=\\\"hidden\\\" value=\\\"综合业务系统更新通知2015年1月6日\\\" id=\\\"titile221\\\">综合业务系统更新通知2015年1月6日</td>\\n					    <td>\\n					    	<input type=\\\"hidden\\\" value=\\\"由于理财第三方划扣金额上限调整，今天中午12:30综合业务系统将进行系统更新，大约需要1个小时，请大家相互转告并及时退出系统，谢谢配合。\\\" id=\\\"detail221\\\">\\n					    	<input type=\\\"hidden\\\" value=\\\"0\\\" id=\\\"noticeStatus221\\\">\\n					    	<a href=\\\"javascript:void(0);\\\" onclick=\\\"getDetail(221);\\\">由于理财第三方