INSERT INTO `new_mg` VALUES ('4', 'uc系统', '/welcome/uc-server/employeeCtrl/editPasswordInput.do \n', '2017-05-05 16:45:44', '<body>\\n    \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n    \\n    \\n        <meta http-equiv=\\\"X-UA-Compatible\\\" content=\\\"IE=8,chrome=1\\\">\\n    \\n\\n<meta http-equiv=\\\"Content-Type\\\" content=\\\"text/html;charset=UTF-8\\\">\\n<meta http-equiv=\\\"Pragma\\\" content=\\\"no-cache\\\">\\n<meta http-equiv=\\\"Cache-Control\\\" content=\\\"no-store, no-cache, must-revalidate, pre-check=0, post-check=0, max-age=0\\\">\\n<meta http-equiv=\\\"Expires\\\" content=\\\"0\\\">\\n<script type=\\\"text/javascript\\\" >\\nvar stcPath = \\\'/static\\\';\\n\\nwindow.onload=function(){ \\n	//firefox and opera backspace   \\n    document.onkeypress = banBackSpace;  \\n    //ie and chorme backspace\\n    document.onkeydown = banBackSpace;  \\n}\\n\\nfunction banBackSpace(e){  \\n    \\n    var ev = e || window.event;     \\n    var obj = ev.target || ev.srcElement;\\n    var t = obj.type || obj.getAttribute(\\\'type\\\');       \\n    \\n    var vReadOnly = obj.readOnly;  \\n    var vDisabled = obj.disabled;  \\n       \\n    vReadOnly = (vReadOnly == undefined) ? false : vReadOnly;  \\n    vDisabled = (vDisabled == undefined) ? true : vDisabled;  \\n    var flag1 = ev.keyCode == 8 && (t == \\\"password\\\" || t == \\\"text\\\" || t == \\\"textarea\\\") && (vReadOnly == true || vDisabled == true);  \\n    var flag2 = ev.keyCode == 8 && t != \\\"password\\\" && t != \\\"text\\\" && t != \\\"textarea\\\";\\n    if (flag2 || flag1)\\n        event.returnValue = false;\\n}  \\n</script>\\n<input type=\\\"hidden\\\" id=\\\"ctx\\\" value=\\\"/welcome\\\">\\n\\n<style>\\n<!--\\n	.messageDiv{\\n		  border-bottom: 0px;\\n		  cursor: default;\\n		  width:100%;\\n		  height:      22px;\\n		  line-height: 22px;\\n		  vertical-align: middle;\\n		  text-decoration: none;\\n		  font-weight: 800;\\n		  font-size: 13px;\\n		  width:100%;\\n		  height:25px;\\n		  font-size:12px;\\n		  background-color:#d6e4ef;\\n	}\\n-->\\n</style>\\n\\n	<div>\\n         <h3 class=\\\"lanmu_div\\\">修改密码</h3>\\n         <div class=\\\"list_cont\\\">\\n            <form method=\\\"post\\\"	action=\\\"/welcome/uc-server/employeeCtrl/updatePassword.do\\\" id=\\\"editForm\\\" class=\\\"addForm\\\">\\n				<table width=\\\"100%\\\" border=\\\"0\\\" cellspacing=\\\"0\\\" align=\\\"center\\\">\\n					<tr>\\n						<td>登录名：</td>\\n						<td><input type=\\\"text\\\"	name=\\\"loginName\\\" value=\\\"张明明\\\" disabled=\\\"disabled\\\" class=\\\"q_name\\\"/>\\n					</tr>\\n					<tr>\\n						<td>原始密码：</td>\\n						<td>\\n							<input type=\\\"password\\\"	name=\\\"oldpassword\\\" id=\\\"oldpassword\\\" class=\\\"required\\\" dataType=\\\"Require\\\" msg=\\\"原始密码不能为空！\\\"/><em>*</em>						\\n						</td>\\n					</tr>\\n					<tr>\\n						<td>新密码：</td>\\n						<td>\\n							<input type=\\\"password\\\"	name=\\\"password\\\" id=\\\"newpassword\\\" dataType=\\\"Require\\\" msg=\\\"新密码不能为空！\\\" /><em>*</em>						\\n						</td>\\n					</tr>\\n					<tr>\\n						<td>确认密码：</td>\\n						<td>\\n							<input type=\\\"password\\\" id=\\\"passwordsure\\\" name=\\\"passwordsure\\\" dataType=\\\"Require\\\" msg=\\\"确认密码不能为空！\\\" /><em>*</em>						\\n						</td>\\n					</tr>\\n					<tr>\\n						<td  align=\\\"center\\\" colspan=\\\"2\\\">\\n							<input type=\\\"button\\\" class=\\\"btn\\\" onclick=\\\"formSubmit();\\\" value=\\\"保存\\\" /> \\n							<input type=\\\"button\\\" class=\\\"btn\\\" value=\\\"重置\\\"	 onclick=\\\"resetForm();\\\" />\\n						</td>\\n					</tr>				\\n                </table>\\n            </form>\\n       </div>\\n</body>', '姓名', '低', '张明明 [1]', '', '', '', '', '0', null, null);
