束时间，最小大于等于结束时间往前三个月，保持时间间隔在三个月以内。使用部门是营业部、销售中心、销售中心贷后管理部。</div>\\n            <h3>字段描述</h3>\\n            <div style=\\\"margin-left: 5px;\\\">进件数：营业部质检通过的进件数，以质检通过时间为条件；</div>\\n            <div style=\\\"margin-left: 5px;\\\">审核件数：信审审核完成的件数，以终审完成时间为条件；</div>\\n            <div style=\\\"margin-left: 5px;\\\">通过件数：信审审批通过的件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">通过金额：信审终审通过的审批金额；</div>\\n            <div style=\\\"margin-left: 5px;\\\">拒贷件数：信审审批拒贷的件数，包括补件超时和外访超时；</div>\\n            <div style=\\\"margin-left: 5px;\\\">回退件数：信审审批回退的件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">实际放款件数：实际放款时间区间内实际放款的件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">实际放款金额：放款成功后的实际放款金额，以实际放款时间为条件；</div>\\n            <h3>计算逻辑</h3>\\n            <div style=\\\"margin-left: 5px;\\\">通过率=通过件数/(通过件数+拒贷的件数+回退件数）；</div>\\n            <div style=\\\"margin-left: 5px;\\\">拒绝率=拒贷件数/(通过件数+拒贷的件数）；</div>\\n            <div style=\\\"margin-left: 5px;\\\">回退率=回退件数/审核件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">通过件均金额=通过金额（万）/通过件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">放款件均金额=实际放款金额（万）/实际放款件数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">人均产能=某团队的放款总金额/该团队的客户经理人数。</div>\\n            <h3>使用部门及权限</h3>\\n            <div style=\\\"margin-left: 5px;\\\">各营业部经理和副经理只能看到本营业部下的数据；</div>\\n            <div style=\\\"margin-left: 5px;\\\">区域经理能看到该区域下的所有数据；</div>\\n            <div style=\\\"margin-left: 5px;\\\">销售总监以下无权限。</div>\\n        </div>\\n        <div class=\\\"clear\\\"></div>\\n    </div>\\n</body>', '地址 姓名 电话', '高', '李瑞雪 李娜 李莹莹 李敏 李艳云 李秀锋 王霁 王妍 王彬 王玉会 王子 张勇 张玲 张东东 张东帅 刘焰斌 陈延鹏 陈朝平 杨文萍 黄姝婷 孙秀男 胡正凯 林发辉 郭强 梁龙 宋文君 谢继光 谢瀛东 于淼 董锁 邓海娟 许涛 [32]', '', '14939742124 14939742124 14939742124 14939742124 14939742124 14939742124 [6]', '', '山东省 江苏省 河北省 湖南省 重庆市 福建省 云南省 四川省 湖北省 山西省 黑龙江省 甘肃省 青海省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省 吉林省合计 宁夏省 [30]', '0', null, null);
