议】、拒绝异议、拒绝复议”；</div>\\n            <div style=\\\"margin-left: 5px;\\\">审核总量：终审审核完成的件数，以终审完成时间为条件。</div>\\n            <h3>计算逻辑</h3>\\n            <div style=\\\"margin-left: 5px;\\\">通过率=通过件数/(通过件数+拒贷的件数+回退件数）；</div>\\n            <div style=\\\"margin-left: 5px;\\\">排序规则：根据每位信审人员的审核总量进行逆序排列；</div>\\n            <div style=\\\"margin-left: 5px;\\\">统计日期：默认统计日期为当前月份的第一天到当前日期；可以根据需要统计的日期范围自由调整统计日期。</div>\\n        </div>\\n        <div class=\\\"clear\\\"></div>\\n    </div>\\n       \\n    <div id=\\\"lt2\\\"  style=\\\"width:340px;display:none;\\\" >\\n        <div class=\\\"web_mapa\\\" style=\\\"height:240px;\\\">\\n            <h2 align=\\\"center\\\">★信审部终审人员统计表-规则说明</h2>\\n            <h3>统计说明</h3>\\n            <div style=\\\"margin-left: 5px;\\\">信审部终审人员统计表统计的是信审部终审的对信贷业务审核情况。使用部门是信审部。</div>\\n            <h3>字段描述</h3>\\n            <div style=\\\"margin-left: 5px;\\\">回退：“进件状态”为“回退【复议】、回退”；</div>\\n            <div style=\\\"margin-left: 5px;\\\">拒贷：“进件状态”为“审批拒贷【异议】、审批拒贷【复议】、审批拒贷”；</div>\\n            <div style=\\\"margin-left: 5px;\\\">通过：“进件状态”为“征信质检通过【异议】、征信质检通过【复议】、征信质检通过、实地信审审批通过【复议】、实地信审审批通过、审批通过【异议】、审批通过【复议】、审批通过、拒绝异议【复议】、拒绝异议、拒绝复议”；</div>\\n            <div style=\\\"margin-left: 5px;\\\">审核总量：终审审核完成的件数，以终审完成时间为条件。</div>\\n            <h3>计算逻辑</h3>\\n            <div style=\\\"margin-left: 5px;\\\">通过率=通过件数/(通过件数+拒贷的件数+回退件数）；</div>\\n            <div style=\\\"margin-left: 5px;\\\">排序规则：根据每位信审人员的审核总量进行逆序排列；</div>\\n            <div style=\\\"margin-left: 5px;\\\">统计日期：默认统计日期为当前月份的第一天到当前日期；可以根据需要统计的日期范围自由调整统计日期。</div>\\n        </div>\\n        <div class=\\\"clear\\\"></div>\\n    </div>\\n</body>', '姓名 电话', '中', '陈凤伟 [1]', '', '14939742496 14939742483 14939742496 14939742483 14939742496 14939742483 14939742496 14939742483 14939742496 14939742496 [10]', '', '', '0', null, null);
