间为条件；</div>\\n        <div style=\\\"margin-left: 5px;\\\">实际审核数：信审终审完成的件数，以终审完成时间为条件；</div>\\n        <div style=\\\"margin-left: 5px;\\\">通过件数：“进件状态”为“征信质检通过【异议】、征信质检通过【复议】、征信质检通过、实地信审审批通过【复议】、实地信审审批通过、审批通过【异议】、审批通过【复议】、审批通过、拒绝异议【复议】、拒绝异议、拒绝复议”；</div>\\n        <div style=\\\"margin-left: 5px;\\\">拒绝件数：“进件状态”为“审批拒贷【异议】、审批拒贷【复议】、审批拒贷”；</div>\\n        <div style=\\\"margin-left: 5px;\\\">回退件数：“进件状态”为“回退【复议】、回退”；</div>\\n        <div style=\\\"margin-left: 5px;\\\">通过金额：信审终审通过的审批金额。</div>\\n        <h3>计算逻辑</h3>\\n        <div style=\\\"margin-left: 5px;\\\">通过率=通过件数/(通过件数+拒绝件数+回退件数）；</div>\\n        <div style=\\\"margin-left: 5px;\\\">件均金额=通过金额/通过件数；</div>\\n        <div style=\\\"margin-left: 5px;\\\">统计日期：默认统计日期为当前月份的第一天到当前日期；可以根据需要统计的日期范围自由调整统计日期。</div>\\n    </div>\\n    <div class=\\\"clear\\\"></div>\\n</div>\\n</body>', '电话', '低', '', '', '14939742568 14939742568 14939742568 14939742568 14939742568 14939742568 [6]', '', '', '0', null, null);
