\n		<td onmouseover=\\\"report1416626over()\\\" class=\\\"report1_3\\\">0.00%</td>\\n		<td onmouseover=\\\"report1416626over()\\\" class=\\\"report1_3\\\">0.00%</td>\\n	</tr>\\n</table><div style=\\\"color:#000000; font-family:宋体; font-size:9pt; padding-top:3px\\\" class=report1>仅<span style=\\\"display:none\\\">416626</span>供<span style=\\\"display:none\\\">416626</span>快<span style=\\\"display:none\\\">416626</span>逸<span style=\\\"display:none\\\">416626</span>报<span style=\\\"display:none\\\">416626</span>表<span style=\\\"display:none\\\">416626</span>免<span style=\\\"display:none\\\">416626</span>费<span style=\\\"display:none\\\">416626</span>版<span style=\\\"display:none\\\">416626</span>使<span style=\\\"display:none\\\">416626</span>用</div>\\n\\n		</td></tr>\\n	</table>\\n    </div>\\n    \\n    <div id=\\\"lt\\\"  style=\\\"width:420px;display:none;\\\" >\\n        <div class=\\\"web_mapa\\\" style=\\\"height:350px;\\\">\\n            <h2 align=\\\"center\\\">★产品预计预警率与逾期率统计表-规则说明</h2>\\n            <h3>统计说明</h3>\\n            <div style=\\\"margin-left: 5px;\\\">产品预计预警率与逾期率统计表统计的是各借款类型放款笔数，放款金额以及各个逾期类型下的逾期情况和预计预警情况，统计时间以实际放款时间为标准，结束时间最大为当前日期，开始时间小于结束时间。使用部门是营业部、销售中心、销售中心贷后管理部。</div>\\n            <h3>字段描述</h3>\\n            <div style=\\\"margin-left: 5px;\\\">放款总笔数：在统计时间内，某借款类型放款的笔数之和；</div>\\n            <div style=\\\"margin-left: 5px;\\\">放款总金额：在统计时间内，某借款类型放款的金额之和；</div>\\n            <div style=\\\"margin-left: 5px;\\\">逾期笔数：放款时间在统计时间内的所有合同中，到当前时间的前一天为止还是逾期类型的合同笔数；</div>\\n            <div style=\\\"margin-left: 5px;\\\">逾期金额：放款时间在统计时间内的所有合同中，到当前时间的前一天为止还是逾期类型的合同金额；</div>\\n            <div style=\\\"margin-left: 5px;\\\">预计预警金额：放款总金额-已还本息之和-余额；</div>\\n            <div style=\\\"margin-left: 5px;\\\">逾期类型：M1，M2,M3,M4,M5,M6,M6+,M3+；</div>\\n            <h3>计算逻辑</h3>\\n            <div style=\\\"margin-left: 5px;\\\">金额逾期率 =逾期金额/放款总金额；</div>\\n            <div style=\\\"margin-left: 5px;\\\">金额预计预警率=预计预警金额/放款总金额；</div>\\n            <div style=\\\"margin-left: 5px;\\\">逾期笔数占比=逾期总笔数/放款总笔数；</div>\\n        </div>\\n        <div class=\\\"clear\\\"></div>\\n    </div>\\n</body>', '电话', '低', '', '', '14939742703 14939742703 14939742703 14939742703 14939742703 14939742703 [6]', '', '', '0', null, null);
