INSERT INTO `new_mg` VALUES ('34', '匠迪技术', '/dl/ext/107?h=1525158CA7979198EF4879F7E6441039&r=0000&v=7.0.6.24466 \0\n', '2017-05-31 17:26:03', '<body>\\n<header id = \\\"header\\\">\\n   <section id = \\\"section\\\">\\n      <a href=\\\"../index.html\\\"><img src=\\\"../images/comme/logo.png\\\" id = \\\"logo\\\"></a>\\n      <p id = \\\"nav\\\">\\n      	<a href=\\\"../index.html\\\">首页</a>\\n      	<a href=\\\"safe.html\\\" style=\\\"background:#ff7214\\\"  class=\\\"safe22\\\">安全产品</a>\\n      	<a href=\\\"serve.html\\\">安全服务</a>\\n      	<a href=\\\"notice.html\\\">新闻资讯</a>\\n      	<a href=\\\"contact.html\\\">关于我们</a>\\n      </p>\\n       <p id = \\\"nav_2\\\">\\n           <a href=\\\"safe.html\\\" style=\\\"background: #005a98\\\">业务安全动态感知系统</a>\\n           <a href=\\\"safe2.html\\\">业务代码安全审查系统</a>\\n       </p>\\n\\n   </section>\\n</header>\\n<div class=\\\"safe_banner\\\">\\n    <img src=\\\"../images/index/banner8.png\\\" alt=\\\"\\\" class=\\\"safe_2\\\">\\n    <!--<a href=\\\"apply.html\\\">申请试用</a>-->\\n</div>\\n\\n\\n\\n<div style=\\\"width: 100%;height: 40px\\\"></div>\\n\\n\\n<main class=\\\"main1_safe\\\">\\n     <div class=\\\"main1_content\\\">\\n         <h1>安全巡检</h1>\\n         <p>匠迪科技的通用漏洞库，含近万个漏洞的优质检测方案。\\n             同时，针对资产的相关业务，巡检会提供高度定制化的漏洞检测方案\\n         </p>\\n         <dl class=\\\"dl\\\">\\n             <dt>\\n                 <img src=\\\"../images/safe/computer.png\\\" alt=\\\"\\\" class=\\\"dt_img\\\">\\n             </dt>\\n             <dd>\\n                 <h3>业务安全动态感知系统</h3>\\n                 <p>业务安全动态感知系统是一套集重要业务数据梳理、\\n                     业务建模、敏感信息深度监测、实施告警以及违规行为全面回溯的智能化监测平台\\n                     。它不仅可以监测外部人员入侵后后的操作行为\\n                     ，同时也可以监测内部人员以及第三份维护企业的违规行为，\\n                     并为事件的追责提供实时告警和事后溯源，\\n                     将原有的信息泄漏事件降低到最小概率，\\n                     甚至将90%以上的内部信息泄露事件消失在萌芽之中。<br/>\\n                     <a href=\\\"apply.html\\\" class=\\\"try_out\\\">\\n                         <img src=\\\"../images/safe/write.png\\\" alt=\\\"\\\" class=\\\"write\\\" style=\\\"margin-left: 4px;\\\">\\n                         <sapn style = \\\" color: #ff7214; font-size: 20px;   line-height: 40px;\\\">&nbsp;&nbsp;申请试用</sapn>\\n                     </a>\\n                 </p>\\n             </dd>\\n         </dl>\\n     </div>\\n</main>\\n\\n<div class=\\\"safe_main\\\">\\n  <h1>为企业提供完善的解决方案</h1>\\n    <table>\\n        <tr>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/money0.png\\\" alt=\\\"\\\" >\\n                <div>资产自动发现</div>\\n                <p>自动梳理发现企业Web业务资产的关键五元组；\\n                    主域名、网站主子域名分布、对外开放IP、\\n                    对外开放服务端口和外界能访问的数据库。</p>\\n            </td>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/money1.png\\\" alt=\\\"\\\">\\n                <div>弱口令探测</div>\\n                <p> 将相关服务平台的账号进行弱口令自动化探测，\\n                    定期与不定期的进行检测，\\n                    实时保障用户的账号不受弱口令风险的侵害。</p>\\n            </td>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/money2.png\\\" alt=\\\"\\\">\\n                <div>异常行为关联分析</div>\\n                <p> 通过对业务人员办理业务的操作行为进行记录，\\n                    智能测算出业务的办理常态化特征。\\n                    将不符合常态化的办理行为通过告警界面展示出来\\n                    ，同时将涉嫌违规的账户近期的所有操作进行智能审计关联，\\n                    力争发现更多可能存在的问题。</p>\\n            </td>\\n        </tr>\\n    </table>\\n</div>\\n\\n\\n\\n\\n<footer id = \\\"footer\\\">\\n    <section id = \\\"footerFirst\\\">\\n        <div id = \\\"centre\\\">\\n            <div class=\\\"first\\\">\\n                <a href=\\\"contact.html\\\" class=\\\"title\\\">联系我们</a>\\n                <img src=\\\"../images/comme/tel.png\\\">\\n                <p>400-690-6007</p>\\n                <span></span>\\n                <p>简易中文</p>\\n                <span></span>\\n            </div>\\n            <div class=\\\"second\\\">\\n                <a href=\\\"safe.html\\\" class=\