INSERT INTO `new_mg` VALUES ('35', '匠迪技术', '/dl/ext/113?h=1525158CA7979198EF4879F7E6441039&r=0000&v=7.0.6.24466 \0\n', '2017-05-31 17:26:11', '<body>\\n<header id = \\\"header\\\">\\n    <section id = \\\"section\\\">\\n        <a href=\\\"../index.html\\\"><img src=\\\"../images/comme/logo.png\\\" id = \\\"logo\\\"></a>\\n        <p id = \\\"nav\\\">\\n            <a href=\\\"../index.html\\\">首页</a>\\n            <a href=\\\"safe.html\\\" style=\\\"background:#ff7214\\\"  class=\\\"safe22\\\">安全产品</a>\\n            <a href=\\\"serve.html\\\">安全服务</a>\\n            <a href=\\\"notice.html\\\">新闻资讯</a>\\n            <a href=\\\"contact.html\\\">关于我们</a>\\n        </p>\\n        <p id = \\\"nav_2\\\">\\n            <a href=\\\"safe.html\\\">业务安全动态感知系统</a>\\n            <a href=\\\"safe2.html\\\" style=\\\"background: #005a98\\\">业务代码安全审查系统</a>\\n        </p>\\n    </section>\\n</header>\\n\\n\\n\\n<div class=\\\"safe_banner\\\">\\n    <img src=\\\"../images/index/banner4.png\\\" alt=\\\"\\\" class=\\\"safe_2\\\">\\n    <!--<a href=\\\"apply.html\\\">申请试用</a>-->\\n</div>\\n\\n\\n\\n\\n<div class=\\\"safe2_main\\\">\\n    <h1>三大优势</h1>\\n    <p class=\\\"annotation\\\">真正意义上的BCodeCheck系统检测方案</p>\\n    <table>\\n        <tr>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/language.png\\\" alt=\\\"\\\" >\\n                <div>多语言</div>\\n                <p>审查代码种类多达11~13种以上，\\n                    是国内审查编程语言种类最多的源代码审查产品。</p>\\n            </td>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/scan.png\\\" alt=\\\"\\\">\\n                <div>整工程扫描</div>\\n                <p> 无需人工分离语言，只需将整个工程文件打包上传\\n                    ，即可按语言分类生成详细报表。</p>\\n            </td>\\n            <td class=\\\"scheme\\\">\\n                <img src=\\\"../images/safe/amity.png\\\" alt=\\\"\\\">\\n                <div>页面友好</div>\\n                <p> 整体漏洞分析与漏洞信息列表详细分析，颜色标注，一目了然。</p>\\n            </td>\\n        </tr>\\n    </table>\\n    <h1>BCodeCheck系统能做什么</h1>\\n    <p class=\\\"annotation\\\" >三部完成代码扫描，\\n        整个开发项目所有源码整体打包压缩，通过BcodeCheck的web界面上传扫描分析，\\n        自动将Java、php、c/c++等主流源码分类扫描并智能生成多维度的图表，\\n        结合专业代码安全分析工程师的整理，完成整个源码安全审计工作 </p>\\n\\n</div>\\n\\n\\n<div class=\\\"safe2_main2\\\">\\n    <div class=\\\"safe2_main2_img\\\">\\n        <img src=\\\"../images/safe/safe2_computer.png\\\" alt=\\\"\\\">\\n    </div>\\n</div>\\n\\n\\n<footer id = \\\"footer\\\">\\n    <section id = \\\"footerFirst\\\">\\n        <div id = \\\"centre\\\">\\n            <div class=\\\"first\\\">\\n                <a href=\\\"contact.html\\\" class=\\\"title\\\">联系我们</a>\\n                <img src=\\\"../images/comme/tel.png\\\">\\n                <p>400-690-6007</p>\\n                <span></span>\\n                <p>简易中文</p>\\n                <span></span>\\n            </div>\\n            <div class=\\\"second\\\">\\n                <a href=\\\"safe.html\\\" class=\\\"title\\\">安全产品</a>\\n                <a href=\\\"safe2.html\\\" class=\\\"titleN\\\">业务安全动态感知系统</a>\\n                <a href=\\\"safe.html\\\" class=\\\"titleN\\\">业务代码安全审查系统</a>\\n            </div>\\n            <div class=\\\"third\\\">\\n                <a href=\\\"serve.html\\\" class=\\\"title\\\">安全服务</a>\\n                <a href=\\\"serve.html\\\" class=\\\"titleN\\\">等级保护预测评服务</a>\\n                <a href=\\\"serve.html\\\" class=\\\"titleN\\\">风险评估服务</a>\\n                <a href=\\\"serve.html\\\" class=\\\"titleN\\\">渗透测试服务</a>\\n                <a href=\\\"serve.html\\\" class=\\\"titleN\\\">代码审计服务</a>\\n            </div>\\n            <div class=\\\"four\\\">\\n                <a href=\\\"contact.html\\\" class=\\\"title\\\">关于我们</a>\\n                <a href=\\\"contact.html\\\" class=\\\"titleN\\\">公司简介</a>\\n                <a href=\\\"contact.html\\\" class=\\\"titleN\\\">发展历程</a>\\n                <a href=\\\"contact.html\\\" class=\\\"titleN\\\">管理团队</a>\\n            </div>\\n\\n\\n            <div