  `create_time` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建报告时间',
  `create_user` varchar(32) DEFAULT '' COMMENT '创建报告人',
  `create_status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '创建报告的状态是否可导出1-导出，0-不可导',
  `reportdoc_name` varchar(64) NOT NULL COMMENT '报告文档名',
  `file_type` varchar(32) NOT NULL DEFAULT 'word' COMMENT '文件类型',
  `remark` varchar(255) DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

