-- ----------------------------
-- Procedure structure for pro_del_before_data
-- ----------------------------
DROP PROCEDURE IF EXISTS `pro_del_before_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_del_before_data`(IN date_inter INT)
BEGIN
	delete from  json_log  where  datediff(curdate(), Date) >= date_inter;
END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for e_del_before_data
-- ----------------------------
DROP EVENT IF EXISTS `e_del_before_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `e_del_before_data` ON SCHEDULE EVERY 1 DAY STARTS '2017-06-05 11:00:00' ON COMPLETION NOT PRESERVE ENABLE COMMENT '定时删除多少天以前的数据的事件' DO CALL pro_del_before_data(15)
;;
DELIMITER ;
